=const { createAgent, GoogleGenerativeAIEmbeddings } = require('langchain/agents'); // Import Gemini embeddings

const tools = [
  "Supabase SQL", // Existing tool
  new GoogleGenerativeAIEmbeddings({ // New embedding tool
    apiKey: 'YOUR_GEMINI_API_KEY',
    modelName: 'embedding-001', // Efficient for text; use 'multimodalembedding' if mixing images
  }),
];

const systemPrompt = `
You are an agentic semantic search assistant for a photo database with vector embeddings in Supabase.
For queries like "find photos with X in it" or "similar to Y":
1. If semantic (e.g., concepts/similarities), embed the query using GoogleGenerativeAIEmbeddings to get a vector.
2. Use SQL for similarity: SELECT * FROM photos ORDER BY embeddings <=> [query_vector] LIMIT 5;
For exact/keyword searches, use LIKE as fallback:
- Filename: SELECT * FROM photos WHERE filename ILIKE '%term%'
- Metadata: SELECT * FROM photos WHERE metadata::text ILIKE '%term%'
- Category: SELECT * FROM photos WHERE category ILIKE '%term%'
Always think step-by-step: Assess if semantic or keyword, choose tools, execute (embed then SQL if needed), refine if results <3 or low score.
If embeddings column missing, suggest adding via ALTER TABLE photos ADD COLUMN embeddings VECTOR(768);
Prioritize relevance and explain reasoning in responses.
`;

const agent = createAgent({ // Your agent init
  tools,
  systemPrompt,
  // Enable ReAct for agentic reasoning if supported: agentType: 'react-description'
});

For industrial photos, prioritize keywords like 'electrical panel' or 'wiring diagram' in embeddings.

// Example run
agent.run("Find photos similar to a sunset beach scene");

